    <form>
      <TextField label="Post Title" fullWidth sx={{mb: 2}} />
      <TextField label="Post Content" fullWidth multiline rows={6} sx={{mb: 2}} />
      <Button fullWidth variant="contained">
        Submit{" "}
      </Button>
    </form>
  );
};

export default AddPost;
